//import { FETCH_RENTALS } from "../actions/types";
const initialState = {
  rentals: []
};

const rental = (state = initialState, action) => {
  switch (action.type) {
    // case FETCH_RENTALS:
    //   return { ...state, rentals: action.rentals };
    default:
      return state;
  }
};

export default rental;
